import React from "react";
import "./main.css";
const Main = () => {
  return (
    <div className="main-container">
      <div className="main-text">
        <h1>Quizzy. It's literally the best.</h1>
        <p>The only place to excel your knowledge.</p>
      </div>
    </div>
  );
};

export default Main;
